import React, { useState } from 'react'

const AddUser = () => {
    // const[firstName,setFirstName]= useState("")
    // const[lastName,setLastName]= useState("")
    // const[email,setEmail]= useState("")
    // const[password,setPassword]= useState("")
    // const[roadNo,setRoadNo]= useState("")
    // const[houseNo,setHouseNo]= useState("")
    // const[city,setCity]= useState("")
    // const[district,setDistrict]= useState("")
    // const[confirmPassword,setConfirmPassword]= useState("")
    const[inputs,setInputs]= useState({
        firstName:"",
        lastName:"",
        email:"",
        password:"",
        roadNo:"",
        houseNo:"",
        city:"",
        district:""
    })
    const {firstName,lastName,email,password,roadNo,houseNo,city,district}=inputs
    const setFirstName=(e)=>setInputs({...inputs,firstName:e.target.value})
    const setLastName=(e)=>setInputs({...inputs,lastName:e.target.value})
    const setEmail=(e)=>setInputs({...inputs,email:e.target.value})
    const setPassword=(e)=>setInputs({...inputs,password:e.target.value})
    const setRoadNo=(e)=>setInputs({...inputs,roadNo:e.target.value})
    const setHouseNo=(e)=>setInputs({...inputs,houseNo:e.target.value})
    const setCity=(e)=>setInputs({...inputs,city:e.target.value})
    const setDistrict=(e)=>setInputs({...inputs,district:e.target.value})
    //const setConfirmPassword=(e)=>setInputs({...inputs,confirmPassword:e.target.value})

    const submitForm = async (e) => {
        e.preventDefault()
        try {
            const body = { firstName, lastName, email, password, roadNo, houseNo, city, district }
            const response = await fetch("http://localhost:5000/auth/register", {
                method: "POST",
                headers: { "Content-Type": "application/json" },
                body: JSON.stringify(body)
            })
            const parseRes = await response.json()
            console.log(parseRes)
        } catch (err) {
            console.error(err.message)
        }
    }
    
  return (
    <div className='mb-4'>
        <form action="">    
            <div className="form-row">
                <div className="form-row">
                    <div className="form-group col-6">
                        <label htmlFor="firstName">First Name</label>
                        <input id="firstName" value={firstName} onChange={e=>setFirstName(e.target.value)} className="form-control" type="text" />
                    </div>
                    <div className="form-group col-6">
                        <label htmlFor="lastName">Last Name</label>
                        <input id="lastName" value={lastName} onChange={e=>setLastName(e.target.value)} className="form-control" type="text" />
                    </div>
                </div>
                <div className="form-group col-6">
                    <label htmlFor="email">Email</label>
                    <input id="email" value={email} onChange={e=>setEmail(e.target.value)} className="form-control" type="email" />
                </div>
            </div>
            <div className="form-row">
                <div className="form-group col-12">
                    <label htmlFor="password">Password</label>
                    <input id="password" value={password} onChange={e=>setPassword(e.target.value)} className="form-control" type="password" />
                </div>
                {/*<div className="form-group col-6">
                    <label htmlFor="password">Confirm Password</label>
                    <input id="password" value={confirmPassword} onChange={e=>confirmPassword(e.target.value)} className="form-control" type="password" />
                </div>*/}
            </div>

            <div className="form-row">
                <div className="form-row">
                    <div className="form-group col-3">
                        <label htmlFor="roadNo">Road No</label>
                        <input id="roadNo" value={roadNo} onChange={e=>setRoadNo(e.target.value)} className="form-control" type="text" />
                    </div>
                    <div className="form-group col-3">
                        <label htmlFor="houseNo">House No</label>
                        <input id="houseNo" value={houseNo} onChange={e=>setHouseNo(e.target.value)} className="form-control" type="text" />
                    </div>
                    <div className="form-group col-3">
                        <label htmlFor="city">City</label>
                        <input id="city" value={city} onChange={e=>setCity(e.target.value)} className="form-control" type="text" />
                    </div>
                    <div className="form-group col-3">
                        <label htmlFor="district">District</label>
                        <input id="district" value={district} onChange={e=>setDistrict(e.target.value)} className="form-control" type="text" />
                    </div>
                </div>
            </div>

            <button type="submit" className="btn btn-success btn-block">Submit</button>
        </form>
    </div>
  )
}

export default AddUser
